// 
const segment4 = [
  ['segment4-0', 'segment4-0'],
  ['segment4-1', 'segment4-1'],
  ['segment4-2', 'segment4-2'],
  ['segment4-3', 'segment4-3'],
  ['segment4-4', 'segment4-4'],
  ['segment4-5', 'segment4-5'],
  ['segment4-6', 'segment4-6'],
]

const segment5 = [
  ['segment5-0', 'segment5-0'],
  ['segment5-1', 'segment5-1'],
  ['segment5-2', 'segment5-2'],
  ['segment5-3', 'segment5-3'],
  ['segment5-4', 'segment5-4'],
  ['segment5-5', 'segment5-5'],
  ['segment5-6', 'segment5-6'],
]

const segment3 = [
  ['segment3-0', 'segment3-0'],
  ['segment3-1', 'segment3-1'],
  ['segment3-2', 'segment3-2'],
  ['segment3-3', 'segment3-3'],
  ['segment3-4', 'segment3-4'],
  ['segment3-5', 'segment3-5'],
  ['segment3-6', 'segment3-6'],
]

const segment1 = [
  ['segment1-0', 'segment1-0'],
  ['segment1-1', 'segment1-1'],
  ['segment1-2', 'segment1-2'],
  ['segment1-3', 'segment1-3'],
  ['segment1-4', 'segment1-4'],
  ['segment1-5', 'segment1-5'],
  ['segment1-6', 'segment1-6'],
]

const segment2 = [
  ['segment2-0', 'segment2-0'],
  ['segment2-1', 'segment2-1'],
  ['segment2-2', 'segment2-2'],
  ['segment2-3', 'segment2-3'],
  ['segment2-4', 'segment2-4'],
  ['segment2-5', 'segment2-5'],
  ['segment2-6', 'segment2-6'],
]

const segment0 = [
  ['segment0-0', 'segment0-0'],
  ['segment0-1', 'segment0-1'],
]

const segment_minus = [['segment_minus-0', 'segment_minus-0']]

const segment_unit = [
   ['segment-unit-0', 'segment-unit-0'],
   ['segment-unit-1', 'segment-unit-1'],
   ['segment-unit-2', 'segment-unit-2'],
   ['segment-unit-3', 'segment-unit-3'],
]

function set_seg_visibility_for_array(seg, switch_array) {
  switch_array.forEach((val, idx) => {
    let elm1 = document.getElementById(seg[idx][0])
    elm1 && elm1.setAttribute('visibility', val ? 'visible' : 'hidden')
    let elm2 = document.getElementById(seg[idx][1])
    elm2 && elm2.setAttribute('visibility', val ? 'visible' : 'hidden')
  });
}

function set_seg_num(seg, num) {
  const switch_array_for_number = [
    [true, true, true, false, true, true, true],      // 0
    [false, true, false, false, false, true, false],  // 1
    [true, true, false, true, true, false, true],     // 2
    [true, true, false, true, false, true, true],     // 3
    [false, true, true, true, false, true, false],    // 4 
    [true, false, true, true, false, true, true],     // 5 
    [true, false, true, true, true, true, true],      // 6 
    [true, true, false, false, false, true, false],   // 7
    [true, true, true, true, true, true, true],       // 8
    [true, true, true, true, false, true, true],      // 9
  ]
  set_seg_visibility_for_array(seg, switch_array_for_number[num])
}

function set_seg_bar(seg) {
  const switch_array = [false, false, false, true, false, false, false]      // '-'
  set_seg_visibility_for_array(seg, switch_array)
}

function set_seg_none(seg) {
  const switch_array = [false, false, false, false, false, false, false]      // ' '
  set_seg_visibility_for_array(seg, switch_array)
}

function set_seg_minus(val) {
  const switch_array = [val]
  set_seg_visibility_for_array(segment_minus, switch_array) // minus mark
}

function set_seg_unit(val) {
  const switch_array = [
   [true, true, true, false], // C (0)
   [true, true, false, true], // F (1)
   ]
  set_seg_visibility_for_array(segment_unit, switch_array[val]) // unit C / F
}

function set_seg_100(val) {
  const switch_array = [
   [false, false], // under 100
   [true, true],   // over  100
   ]
  set_seg_visibility_for_array(segment0, switch_array[val])
}

function set_temperature(temp, unit) {
  if (isNaN(temp) || temp == undefined || temp == null || 200 <= temp) {
    set_seg_bar(segment1)
    set_seg_bar(segment2)
    set_seg_bar(segment3)
    set_seg_minus(false)
    set_seg_100(0)
  } else {
    set_seg_minus(temp < 0)
    set_seg_100((100 <= temp) ? 1 : 0)
    temp = Math.abs(temp)
    let integer = Math.floor(temp % 100)
    let upper = parseInt(integer / 10)
    let lower = integer % 10
    let after = Math.floor(parseFloat("0."+(String(temp)).split(".")[1]) * 10)
    if (upper == 0 && (temp < 100)) {
      set_seg_none(segment1) 
    } else {
      set_seg_num(segment1, upper)
    }
    set_seg_num(segment2, lower)
    set_seg_num(segment3, after)
  }
  set_seg_unit(unit)  
}

function set_humidity(humidity) {
  if (isNaN(humidity) || humidity == undefined || humidity == null || (humidity < 0 || 99 <= humidity)) {
    set_seg_bar(segment4)
    set_seg_bar(segment5)
    set_seg_minus(false)
  } else {
    let integer = Math.floor(humidity)
    let upper = parseInt(integer / 10)
    let lower = integer % 10
    if (upper == 0) {
      set_seg_none(segment4) 
    } else {
      set_seg_num(segment4, upper)
    } 
    set_seg_num(segment5, lower)
  }
}

function load_temp_humi() {
    let deviceId = document.defaultView.frameElement.getAttribute('deviceid');
    let api_path = `/wp-json/show-switchbot-meter/v1/${deviceId}`
    fetch(api_path).then(r => r.json()).then(j => {
        if (j.status != 'ok') {
            throw new Error('status invalid')
        } else {
            set_temperature(j.temperature, (j.unit) && (j.unit==1) ? 1 : 0)
            set_humidity(j.humidity)
        }
    }).catch(e => {
        set_seg_bar(segment1)
        set_seg_bar(segment2)
        set_seg_bar(segment3)
        set_seg_minus(false)
        set_seg_bar(segment4)
        set_seg_bar(segment5)
        set_seg_unit(0)
        set_seg_100(0)
    })
}

load_temp_humi()

//
